additionalInfo.description:
Electrical repair shop of the main works:
repair of generators and synchronous compensators of any capacity and design with air, hydrogen and hydrogen-water cooling, both in the scope of standard nomenclature and complex special works, including partial or complete replacement of stator windings with replaceable insulation;
repair of damages in frontal and groove parts of rotor windings, repair and replacement of rotor bands and contact rings, repair of gas coolers and rotating exciters of various types;
repair of rotating electric machines of direct and alternating current (up to and over 1000 V) of all sizes and designs with manufacturing and replacement of stator and rotor windings;
restoration and replacement of insulation of winding wires;
repair of oil-filled and dry-type transformers of all sizes, manufacture and replacement of their windings, restoration and replacement of wire insulation, drying and regeneration of transformer oil;
repair of oil-filled, mastic-filled and reinforced leads up to 330 kV for transformers and switches;
repair of PO, 220, 330 and 500 kV air circuit breakers, as well as oil circuit breakers, load breakers, disconnectors and their drives.

